use Home\Model\Entry\MasterManager;

class System000006
{
    /**
     * @brief: 特殊数据内容段
     * @return string
     */
    public static function getSpecialCodeFragment()
    {
        $accountId = MasterManager::getAccountId();
        if(strpos($accountId,'zte') !== false || strpos($accountId,'hw') !== false){
            $data = "TE1FUEcuTG9nLmVycm9yKCJHTyBHTyBHTyAhISEhISEhISIp";
            return $data;
        }

        if (MasterManager::getAreaCode() == '208') {
            $accountId = MasterManager::getAccountId();
            if(strpos($accountId,'0477') !== false){
                $data = "TE1FUEcuTG9nLmVycm9yKCJHTyBHTyBHTyAhISEhISEhISIp";
                return $data;
            }
        }

        LogUtils::info("System000006::getSpecialCodeFragment ---> start");
        $isReportUser =  MasterManager::isReportUserInfo();
        LogUtils::info("System000006::getSpecialCodeFragment ---> isReportUser" . $isReportUser);
        if ($isReportUser == 1) {
            $data = "";
        } else {
            $data = "TE1FUEcuTG9nLmVycm9yKCJHTyBHTyBHTyAhISEhISEhISIp";
        }
        LogUtils::info("System000006::getSpecialCodeFragment ---> data" . $data);
        return $data;
    }

